window.bookSummaryJSON = "<p>Levi's got it all. He's a paranormal prince with more money and power than he knows what to do with, but something is missing - a mate. He has only until college graduation to find her. Allie's perfect, but she wants nothing to do with him. When attraction becomes something more, will he take a chance and show her who he really is, or will he lose everything? </p> <p>Levi's almost out of time. Allie's the one - he knows it in every grain of his being - but how can he make her see it? Desperate to keep Allie safe and at his side, he takes the biggest risk of his life. Reckless or not, there is nothing he wouldn't do to keep her with him...forever. </p>"; 
